/* Model creation/destruction functions */

void MODEL_dram_scheduler::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  dram_scheduler_instance = new MOD_dram_scheduler(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (dram_scheduler_instance->INST_buffer_fifo.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_0.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_1.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_2.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_3.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_4.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_5.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_6.set_clk_0)("CLK");
  (dram_scheduler_instance->INST_req_fifo_7.set_clk_0)("CLK");
  (dram_scheduler_instance->set_clk_0)("CLK");
}
void MODEL_dram_scheduler::destroy_model()
{
  delete dram_scheduler_instance;
  dram_scheduler_instance = NULL;
}
void MODEL_dram_scheduler::reset_model(bool asserted)
{
  (dram_scheduler_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_dram_scheduler::get_instance()
{
  return dram_scheduler_instance;
}

