/* VCD dumping functions */
MOD_dram_scheduler & dram_scheduler_backing(tSimStateHdl simHdl)
{
  static MOD_dram_scheduler *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_dram_scheduler(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_dram_scheduler::dump_VCD_defs()
{
  (dram_scheduler_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_dram_scheduler::dump_VCD(tVCDDumpType dt)
{
  (dram_scheduler_instance->dump_VCD)(dt, vcd_depth(sim_hdl), dram_scheduler_backing(sim_hdl));
}
